map.setup = function(map_container_node){
	map.container = d3.select(map_container_node).style("padding","0px"); //removing padding makes width calcs simple
	
	map.container.append("p").classed("gcx-section-header",true)
							 .text("Metropolitan areas participating in the Exchange")
							 .style("margin-left","5px");

	map.wrap_outer = map.container.append("div");

	map.wrap_inner = map.wrap_outer.append("div").style("padding", "0em 0px");



	map.wrap = map.wrap_inner.append("div");
	map.tooltip = map.wrap.append("div").style({position:"absolute", visibility:"hidden", "z-index":"0"})
	
	map.legend = map.wrap.append("div").style("float","right");
	map.svgwrap = map.wrap.style("z-index","10").classed("c-fix",true)
					  .append("div").style("float","left");

	map.svg = map.svgwrap.append("svg").style({"height":"100%","width":"100%","z-index":"10"});
	
	map.borders = map.svg.append("g");
	map.dots = map.svg.append("g");
	map.anno = map.svg.append("g");
	

	map.proj = d3.geo.albersUsa();  
	map.path = d3.geo.path(); 

	map.data = [];
	for(var i in map.geo.metros){
		if(map.geo.metros.hasOwnProperty(i)){
			map.geo.metros[i].xy = [0,0]; //mutate original data
			map.data.push(map.geo.metros[i]);
		}
	}

	map.max_width = 1100;
	map.legend_width = 200;
	map.wrap_outer.style({"max-width":map.max_width+"px", margin:"0px auto"});	
	map.legend.style("width",map.legend_width+"px");

	//cohort colors -- revised Feb 2016
	map.cols = [null,"#4575b4","#74add1","#f46d43","#fdae61","#fee090","#fdae61"];
	map.cohorts = [
		{
			group:"Phase 1: Exports", 
			values:[
				{t:"Completed", v:1},
				{t:"Started in Q1 2015", v:2}
			]
		},
		{
			group:"Phase 2: FDI",
			values:[
				{t:"Completed", v:3},
				{t:"Started in Q1 2016", v:5},
				{t:"Started in Q3 2016", v:6}
			]
		}
	]
}

map.build_legend = function(){

	var dotsize = map.dim.w < 700 ? 12 : 14;
	var fs = map.dim.w < 700 ? "13px" : "15px";
	var mtop = map.dim.w < 700 ? "0px" : Math.round(map.dim.h*0.15)+"px";


	var groups = map.legend.style("margin",mtop+" auto 0px auto").selectAll("div.legend-group").data(map.cohorts);
	groups.enter().append("div").classed("legend-group",true).append("p");
	groups.exit().remove();
	groups.style("margin","1em 1em 1em 1em").style("float","left");

	groups.select("p").text(function(d,i){return d.group}).style("margin","0px")
														  .style("font-size",fs);


	var swatches = groups.selectAll("div.swatch").data(function(d,i){return d.values});
	var swatch_enter = swatches.enter().append("div").classed("swatch c-fix",true);
	swatches.exit().remove();
	swatches.style("margin","0.5em 0em");

	swatch_enter.append("div").style({float:"left"});
	swatch_enter.append("p").text(function(d,i){return d.t}).style({float:"left", margin:"0px 0px 0px 5px"});

	swatches.select("p").style({"font-size":fs, "line-height":fs});
	swatches.select("div").style({"float":"left", "height":dotsize+"px", "width":dotsize+"px", "border-radius":(dotsize/2)+"px"})
							  .style("background-color", function(d,i){return map.cols[d.v]});

}

map.scale = function(){
	try{
		var rect = map.container.node().getBoundingClientRect();
		
		var window_width = Math.max(document.documentElement.clientWidth, (window.innerWidth || 0));
		var max_margin = Math.min(rect.left, (window_width-rect.right));

		var container_width = Math.round(rect.right - rect.left);
		var w = (container_width + (2*max_margin) );
		if(w > map.max_width){w = map.max_width}

		var margin_left = ((container_width - w)/2);
	}
	catch(e){
		console.log(e);
		var w = 650;
		var margin_left = 0;
	}

	//w_ is the map container width minus space reserved for legend (i.e. the actual map width)
	if(w < 500){
		var w_ = w;
		map.svgwrap.style("float","none");
		map.legend.style("width","auto").style("float","left");
	}
	else{
		var w_ = w-map.legend_width-2;
		map.svgwrap.style("float","left");
		map.legend.style("width",map.legend_width+"px").style("float","right");
	}

	
	var h = w_*(.64);
	var dots = [4,6,9];
	var fs = ["9px","11px","13px"];
	
	map.dim = {scale:w_*1.25, translate:[w_/2, h/2]};

	var sml = map.dim.scale < 600 ? 0 : (map.dim.scale < 800 ? 1 : 2); //small, medium, or large (1,2, or 3)
	
	map.dim.r = dots[sml];
	map.dim.fs = fs[sml];
	map.dim.level = sml;
	map.dim.h = h;
	map.dim.w = w;
	map.dim.w_ = w_;
	map.dim.fourth = 130; 

	map.svg.style("height",h+"px").style("width",w_+"px");
	map.wrap_outer.style("width",w+"px")
		   		  .style("margin-left",margin_left+"px");

	map.proj.scale(map.dim.scale).translate(map.dim.translate);
	map.path.projection(map.proj);

	//update xy property for each geo
	for(var i=0; i<map.data.length; i++){
		map.data[i].xy = map.proj([map.data[i].Lon, map.data[i].Lat]);
	}
}

//text annotation position functions
map.annoTextPosY = function(code){
  var above = true;
  if(code in {"M41180":1, "M12580":1, "M31140":1, "M41700":1, "M12060":1,
            "M45300":1, "M27260":1, "M16700":1, "M41740":1, }){above=false}

  try{
  	var fs = parseInt(map.dim.fs);
  }
  catch(e){
  	var fs = 11;
  }

  return above ? 0-map.dim.r-3 : 0+map.dim.r+ (0.8*fs);
}

map.annoTextPosTA = function(code){
  var dx = "start";
  if(code in {"M19780":1, "M26900":1}){dx = "end"}
  return dx;
}

//call scale before drawBasic and drawSelect

map.drawBasic = function(){
	map.states = map.borders.selectAll("path").data([map.stjson]);
				map.states.enter().append("path").attr({"fill":"#dddddd","stroke":"#ffffff","stroke-width":"0.5px"});
				map.states.exit().remove();
				map.states.attr("d",map.path)
	
	map.cities = map.dots.selectAll("circle.sm-city-dot").data(map.data);
				map.cities.enter().append("circle").classed("sm-city-dot",true).attr({fill:"#ffffff", stroke:"#ffffff", r:"1"});
				map.cities.exit().remove();

				map.cities.attr("cx",function(d,i){return d.xy[0]})
						  .attr("cy",function(d,i){return d.xy[1]})			
}	

map.drawSelect = function(dat){

	var dotGroups = map.dots.selectAll("g").data(dat);
	var dotGroupsE = dotGroups.enter().append("g").classed("dotGroup",true);
		dotGroups.exit().remove();

		dotGroups.attr("transform",function(d,i){
							var m = map.geo.metros[d.id];
							return "translate("+m.xy[0]+","+m.xy[1]+")";
							});

		//one time appends to each dot group (using enter)
		dotGroupsE.append("circle").attr({"cx":0, "cy":0, stroke:"#ffffff", "stroke-width":"1px"});
		dotGroupsE.append("text");
		dotGroupsE.append("text");

	var gcxDots = dotGroups.select("circle");

	gcxDots.attr("fill",function(d,i){
	        var m = map.geo.metros[d.id];
	        return map.cols[m.Cohort];
	    }).attr("r",map.dim.r);

	var gcxLabels = dotGroups.selectAll("text")
						.attr({"x":"0", "y":"0"})
						.attr("dy", function(d,i){
							return map.annoTextPosY(d.id);
						})
						.attr("text-anchor",function(d,i){
							return map.annoTextPosTA(d.id)
						})
						.attr("dx",function(d,i){
						      try{
						        if(d.id==="M16980"){var dx = "-2px"}
						        else{
						          var dx = d3.select(this).attr("text-anchor")==="start" ? "-18px" : "18px";
						        }
						      }
						      catch(e){
						        var dx = "0px";
						      }
						      finally{
						        return dx;
						      }
						})
						.attr("stroke", function(d,i){return i==0 ? "#ffffff" : "#333333"})
						.attr("stroke-width", function(d,i){return i==0 ? "3px" : "0px"})
	    				.style({"font-size": map.dim.fs})
	    				.text(function(d,i){return d.name});
}



function build_map(container, gcx_data){
	var D = !!gcx_data ? gcx_data : [];

	map.setup(container);
	
	map.scale();
	map.build_legend();

	map.drawBasic();
	map.drawSelect(D);

	window.addEventListener("resize", function(){
		map.scale();
		map.build_legend();

		map.drawBasic();
		map.drawSelect(D);
	});
}

//split vector into matrix with col columns
var v2m = function(arr, col){
    var i=0;
    var mat = [];
    var len = arr.length;
    while(i<len){
        var j=0;
        var row = [];
        while(j<col && (i+j)<len){
        	row.push(arr[(i+j)])
            j=j+1;
        }
        mat.push(row);
    	i=i+col;
    }
    return mat;
}

function list_products(dat){
	var gti = [];
	var exp = [];
	var inp = [];

	for(var i=0; i<dat.length; i++){
		if(dat[i].plans.length > 0){
			if(dat[i].plans[0].title=="Global Trade and Investment plan"){
				gti.push(dat[i]);
			}
			else{
				exp.push(dat[i]);
			}
		}
	}

	//manually compile in-progress data array
	inp.push("Baltimore (exports and FDI)");
	inp.push("Charleston (FDI)");              
	inp.push("Chicago (FDI)");    
	inp.push("Fresno (FDI)");
	inp.push("Houston (FDI)");
	inp.push("Indianapolis (FDI)");
	inp.push("Louisville-Lexington (FDI)");
	inp.push("Phoenix (FDI)");
	inp.push("Salt Lake (FDI)");
	inp.push("St. Louis (FDI)");
	inp.push("Tampa Bay (FDI)");
	inp.push("Wichita (FDI)");

	var pdata = [
		{
			title:"Global trade and investment plans",
			subtitle: "These supplant existing export plans",
			data: gti
		},
		{
			title:"Export plans",
			subtitle: null,
			data: exp
		},
		{
			title:"Planning in progress",
			subtitle: "Phase is noted in parentheses",
			data: inp
		}
	];

	var product_groups = d3.select("#gcx-product-tables")
						   .selectAll("div")
						   .data(pdata);

	product_groups.enter().append("div").append("div").classed("title-wrap",true).style({"margin":"0em 0em 0.5em 0em", "border-bottom":"0px solid #dddddd"});
	product_groups.exit().remove();
	product_groups.style("margin", function(d,i){return i==0 ? "2em 0em" : "2em 0em"});

	var product_group_titles = product_groups.select("div.title-wrap").selectAll("p")
											.data(function(d,i){
												var t = !!d.subtitle ? [d.title, d.subtitle] : [d.title];
												return t;
											});
	product_group_titles.enter().append("p");
	product_group_titles.exit().remove();

	product_group_titles.text(function(d,i){return d})
						.style("font-weight",function(d,i){return i===0 ? "bold" : "normal"})
						.style("font-style",function(d,i){return i===1 ? "italic" : "normal"})
						.style("margin","0px");


	var tables = product_groups.selectAll("table").data(function(d,i){return [d.data]});
	tables.enter().append("table").append("tbody");
	tables.exit().remove();
	tables.style({"width":"100%"});


	var rows = tables.select("tbody").selectAll("tr").data(function(d,i){
		return v2m(d, 3);
	});
	rows.enter().append("tr");
	rows.exit().remove();

	var cols = rows.selectAll("td").data(function(d,i){return d});
	cols.enter().append("td");
	cols.exit().remove();
	cols.style({"width":"33%"});

	cols.each(function(d,i){
		var thiz = d3.select(this);
		try{
			if(!d.plans[0].url){
				throw "no_url";
			}
			else{
				thiz.selectAll("a").remove();
				thiz.append("a")
					.attr("href", d.plans[0].url)
					.attr("target","_blank")
					.text(d.name + " »");				
			}
		}
		catch(e){
			thiz.text(d);
		}
	});

}

var asset_repo = "./";


var parser = function(d){
	var ep = d.Export_Plan !== "" ? {title:"Export plan", url: d.Export_Plan} : null;
	var gti = d.Global_Trade_and_Investment_Plan;
	var fp = gti !== "" ? {title:"Global Trade and Investment plan", url:gti} : null;
	var plans = [];

	if(fp){plans.push(fp)}
	else if(ep){plans.push(ep)}

	//need an entry for no plans completed
	return {id:d.CBSA_Code, name:d.firstcity, plans:plans};
}


function main(){
	d3.csv((asset_repo + "GCXPlans_11May2016.csv"), parser, function(E,D){
		if(E){
			console.log(E);
			//Feed error
		}
		else{
			D.sort(function(a,b){
				if(a.plans.length==0 && b.plans.length==0){
					var idx = a.name <= b.name ? -1 : 1;
				}
				else if(a.plans.length==0){ var idx = 1}
				else if(b.plans.length==0){ var idx = -1}
				else{ var idx = a.name <= b.name ? -1 : 1;}
				return idx;
			})
			
			list_products(D);
			build_map(document.getElementById("us-map"), D);
		}
	});
}

document.addEventListener("DOMContentLoaded", function(){
	main();
});

